class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        if not grid or not grid[0]:
            return 0

        m = len(grid)
        n = len(grid[0])
        islands = 0

        def dfs(i, j):
            if i < 0 or i >= m or j < 0 or j >= n or grid[i][j] != '1':
                return

            grid[i][j] = '0'  # Mark as visited

            # Visit all 4 directions
            dfs(i + 1, j)
            dfs(i - 1, j)
            dfs(i, j + 1)
            dfs(i, j - 1)

        for i in range(m):
            for j in range(n):
                if grid[i][j] == '1':
                    dfs(i, j)
                    islands += 1

        return islands

class Solution {

    /**
     * @param String[][] $grid
     * @return Integer
     */
    function numIslands($grid) {
        if (empty($grid) || empty($grid[0])) {
            return 0;
        }

        $m = count($grid);
        $n = count($grid[0]);
        $islands = 0;

        for ($i = 0; $i < $m; $i++) {
            for ($j = 0; $j < $n; $j++) {
                if ($grid[$i][$j] == '1') {
                    $this->dfs($grid, $i, $j, $m, $n);
                    $islands++;
                }
            }
        }

        return $islands;
    }

    private function dfs(&$grid, $i, $j, $m, $n) {
        // Check bounds and if current cell is water or already visited
        if ($i < 0 || $i >= $m || $j < 0 || $j >= $n || $grid[$i][$j] != '1') {
            return;
        }

        // Mark current cell as visited
        $grid[$i][$j] = '0';

        // Visit all 4 directions
        $this->dfs($grid, $i + 1, $j, $m, $n); // down
        $this->dfs($grid, $i - 1, $j, $m, $n); // up
        $this->dfs($grid, $i, $j + 1, $m, $n); // right
        $this->dfs($grid, $i, $j - 1, $m, $n); // left
    }
}

